Open a command prompt window Navigate to a directory wherein we will create a test project. Run the command cargo new --bin hellorust to create a new project named "hellorust". Cargo is the Rust build system and package manager. The --bin argument means we are creating a binary project that builds an executable. We can also create a crate (Rust's name for libraries) by passing the --lib argument. The cargo new command creates a new directory named "hellorust" and creates the default Rust project directory structure hellorust
- src - main.rs
- Cargo.toml
- Cargo.lock
- target The src directory contains the project's Rust source code files Cargo.toml contains the project configuration used by Cargo to build the project. This file includes dependencies, build configurations, metadata, and more. Cargo.lock is generated by Cargo and contains the "locked" or exact versions of the dependencies used to build your project. This file should not be edited. The target directory contains the build products generate by Cargo. For a binary project, the exectuable will usually be at target\debug\hellorust (or target\release\hellorust). Navigate into the "hellorust" directory Build the project by running the command cargo build By default, Cargo will build the project in the debug configuration You can build the release configuration with the command: cargo build --release If you see an error about "Link.exe", make sure the installation dependencies are met (detailed in the installation section above) Running Cargo build Run the project with the command: cargo run This command will also build the project if your build is out-of-date By default, cargo run builds and runs the debug configuration. You can run the release configuration with: cargo run --release. Arguments after cargo run are passed to Cargo (for example the --release argument). If you want to pass arguments to your program, put them after a -- delimiter. For example: cargo run --release -- my args here Running Cargo project Many Rust projects include automated tests. Cargo can run these tests with the command cargo test (--release works here too). To try out Rust tests, we can modify src/main.rs to contain a simple failing test: Modify main.rs: fn main() { println!("Hello, world!");
} #[test]
fn failing_test() { assert!(2 + 2 == 5);
} Run the tests with cargo test Using Cargo to run tests

