Rust differs from C/C++ in that if, and other control flow structures, are also expressions that evaluate to a value. For example, the below if statement conditionally returns one of two strings. Notice that there are no semicolons after the return values, just like function return values. fn main() { println!("The world is {}", if 1 + 1 == 2 { "sane" } else { "insance" });
} This if expression behaves much like the ternary operator in C/C++, but also allows you to have multiple else if predicates without nesting. Control flow statements in Rust evaluate to a value, even if you are not using that value. If you end a branch with ;, the return value will be (), the same as a function without a specified return value. Therefore, all the possible evaluations of the control structure need to return the same type. For example, the below code will not compile. fn main() { if 1 + 1 == 2 { println!("The world is sane."); } else { 5 }
} It's quite common in Rust to see functions that look like below. The return value of the function is the evaluated value of the if expression. fn square_if_over_10(i: i32) -> i32 { if i > 10 { i * i } else { i }
}

