The Rust standard library provides a large selection of combinators for use with iterators. Here's a whirlwind tour of a few important ones! You can find a full list in the documentation for the Iterator trait . The map method takes a closure to apply on each iterated element. It's the equivalent of running a given function on each element in the iterator and generating a new iterator of the return values. fn main() { for i in (0..10).map(|i| i * 2) { println!("{}", i); }
} The filter method skips values that don't pass a predicate. fn main() { for (i, j) in (1..10).map(|i| (i, i * 3)).filter(|(i, j)| i % 2 == 0) { println!("{} tripled is even: {}", i, j); }
} flat_map iterates through iterators and concatenates them one after the other, or "flattens" them. fn main() { for i in (1..5).flat_map(|i| 0..i) { println!("{}", i); }
} fold combines all the values from an iterator, pairwise, starting with an initial value. fn factorial(n: i32) -> i32 { (1..n).fold(n, |x, y| x * y)
} fn main() { println!("5! = {}", factorial(5));
} If you want even more combinators, make sure to check out the docs . And, if you want even more combinators, checkout the itertools crate!

