Sometimes, you miss your familar C-style for loop with its convenient access to the index; but don't run away yet, Rust has the enumerate() combinator for just this problem. The Iterator trait provides a combinator, called enumerate just for this purpose (very similar to Python's enumerate()). fn main() { for (index, value) in (100..110).enumerate() { println!("{}: {}", index, value); }
} You might have noticed in the above example that enumerate changed the iterator elements from integers to tuples (which is why we use for (index, value) ...). When you chain iterators together, you can modify the type of the iterator element as you go. It's common to see code that keeps an index or other book-keeping info along with the value of interest in a tuple: fn main() { for (index, value) in (100..110) .enumerate() .map(|(i, v)| (i, v * 10)) { println!("{}: {}", index, value); }
}

