We’ve got all the datatypes you would expect but you might want to glance through the Rust book chapter on variables, functions, and control flow just to update your mental models to Rust notation We have signed and unsigned scalar types like u32 and i32 and we've got Strings. Variables are instantiated with let syntax, and notably are immutable by default. The top of the Rust standard library page has a search box. Entering String there we find std::string::String with a bunch of example usage right there for us. You can edit those examples and run them right in your browser to confirm your understanding and even click the [src] link in the upper right corner and be taken straight to the Rust implementation. While you totally can thrash around on stack overflow, and we all do, there really is an authoritative source that you should check first. From that example we have our String constructor: fn main() { let input_path = String::from("cat.jpg"); println!("Hello, world!");
} First, note we don’t need to import anything (we call it use) to use this type. A portion of the standard library is in our namespace automatically, which we call the prelude . Basically Rust puts use std::prelude::v1::*; at the top of your file and you get access to those members. By no means is everything in there, but a lot is, which is what kept you from explicitly writing use std::string::String at the top of your file in this case. Also notice we didn't have to explicitly type our variable. What Rust can figure it out, it will and so its entirely idiomatic to omit type annotations. However if you or the compiler are having trouble or getting odd type errors, start annotating some of your types like to see if you can give the compiler a hand. Its also a great way to figure out what type you actually have in case you're not sure, let the compiler (or linter) tell you. fn main() { let input_path = String::from("cat.jpg"); let output_path:String = String::from("test.png"); println!("Hello, world!");
} So now how to print those variables to console. In Rust our printf % formatting character is {}. Following the println!() documentation down the rabbit hole will send us to the formatters section page and we find all the formatters which you would expect like hex {:x}, binary {:b}, etc. We're going to focus on the 'empty' Display formatter {} for now which is a kind of a pretty printer in Rust. As long as whomever wrote our type implemented the Display pretty printer trait this will work great (cue ominous music). fn main() { let input_path = String::from("cat.jpg"); let output_path = String::from("test.png"); println!("{} {}", input_path, output_path);
} Running this we find that we do have a Display implementation for String and pretty printing results in rather clean output in this case: cat.jpg test.png Objects, we call them structs, should be very familiar. You can define a new struct in any scope you like and we can name and type their members. struct Opt { input_path: String, output_path: String,
} fn main() { let options = Opt { input_path: String::from("cat.jpg"), output_path: String::from("test.png"), }; println!("{} {}", options.input_path, options.output_path);
} Notice we access our struct members with dot notation, and there is no default new constructor or overloading in Rust. Though in practice, for functions where it makes sense many developers will offer and occasionally make their struct private to require the usage of a new or other constructor. So note, String::new() totally exists and would have made you an empty string. Lets start modularizing our main by putting our options creation in a function. Function syntax is just like we see in the main function, but can return an expression from a function by leaving off the semicolon and annotating the return type: struct Opt { input_path: String, output_path: String,
} fn options() -> Opt { let options = Opt { input_path: String::from("cat.jpg"), output_path: String::from("test.png"), }; return options;
} fn main() { let options = options(); println!("{} {}", options.input_path, options.output_path);
} We use semicolons to end expressions. We prefer to leave off semicolons in order to implicitly return the expression saving us the temporary variable like so: fn options() -> Opt { Opt { input_path: String::from("cat.jpg"), output_path: String::from("test.png"), }
} But what if our options creation could fail? Lets talk about error handling in rust.

