test.png So what is this unwrap. The problem is the nth argument may or may not be there.. We have two related types commingled in error handling in Rust. Rust doesn’t have exceptions, but rather the Result type which can be used to propagate either the error or the result and looks like this: pub enum Result<T, E> { Ok(T), Err(E),
} And Rust doesn't have Null but rather the Option type which can be used to propagate either the value (Some), or the lack of one (None) pub enum Option<T> { None, Some(T),
} Were going to skip Result here, as our nth() method returns an Option, but they’re very similar in how they’re handled as they’re both implemented as enums. We basically have three possibilities for dealing with both:
